import React from 'react';
import './App.css';

function App() {
  return (
      <div id="siteWrapper">
          <div id="header">
              <div className="header-inner">
              <img alt="" src={"./images/LogoCard.bmp"} />
            </div>
            <div>
              <img className="content-fill" alt="" src={"./images/cecistyle1.jpg"} />
            </div>
          </div>
      </div>
  );
}

export default App;
